import React from 'react'
import "./header.css"

const Header = () => {
  return (
    <Container>
      <TitleWrapper>
        <Title>Timeless Tales</Title>
      </TitleWrapper>
      <HeaderImg src="../assets/Header.jpg"></HeaderImg>
    </Container>
  );
}

export default Header
